import React , { Component } from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";
import ProgressBar from 'react-bootstrap/ProgressBar';
import { Container } from 'react-bootstrap';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const GameMap = (props) => {
        return(
            <div className="w-75 bg-danger">
                <div class="container w-75">
                    <div class="row justify-content-end w-75">
                        <div class="col-4">
                            <button className={'btn btn-primary'}>Room One</button>-
                            <button className={'btn btn-primary'}>Room Two</button>-
                            <button className={'btn btn-primary'}>Room Three</button>-
                            <button className={'btn btn-primary'}>Room Four</button>
                        </div>
                        <div class="row justify-content-end">
                            <div class="col-4">
                                <button className={'btn btn-primary'}>Room Five</button>-
                                <button className={'btn btn-primary'}>Room Six</button>-
                                <button className={'btn btn-primary'}>Room Seven</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
}

export default GameMap;
